"""
Print Logic for 58mm/80mm Thermal Printer
Updated with Kalimati font embedded for correct Nepali (Devanagari) rendering.

FIX: The "box" issue was caused by Arial not supporting Devanagari Unicode.
     Kalimati.otf is now embedded directly in the HTML via base64 @font-face.
     This ensures all Nepali labels and values render correctly on all systems.
"""

import unicodedata
from datetime import datetime
import streamlit as st

# Kalimati font embedded as base64 for offline Devanagari rendering
_KALIMATI_B64 = ""

def _get_font_face_css():
    """Return @font-face CSS block with embedded Kalimati font."""
    return f"""
    @font-face {{
        font-family: 'Kalimati';
        src: url('data:font/otf;base64,{_KALIMATI_B64}') format('opentype');
        font-weight: normal;
        font-style: normal;
    }}
    """


def normalize_text(text):
    """Normalize text for consistent display"""
    if not isinstance(text, str):
        text = str(text)
    return unicodedata.normalize('NFC', text.strip())


def center_text(text, width=42):
    """Center text within specified width"""
    text = str(text)
    padding = (width - len(text)) // 2
    return ' ' * padding + text


def split_text(text, width=42):
    """Split text into lines of specified width"""
    text = str(text)
    lines = []
    words = text.split()
    current_line = ""
    
    for word in words:
        if len(current_line + word) + 1 <= width:
            current_line += word + " "
        else:
            if current_line:
                lines.append(current_line.strip())
            current_line = word + " "
    
    if current_line:
        lines.append(current_line.strip())
    
    return lines


def format_divider(char='=', width=42):
    """Create a divider line"""
    return char * width


def format_voter_receipt(voter_data):
    """
    Format voter data for 58mm thermal printer (text mode)
    """
    lines = []
    
    lines.append(format_divider('='))
    lines.append(center_text(" "))
    lines.append(center_text("VOTER DETAILS"))
    lines.append(format_divider('='))
    lines.append("")
    
    if ' ' in voter_data:
        lines.append(center_text(f" : {voter_data[' ']}"))
        lines.append(format_divider('-'))
    
    if '..' in voter_data:
        lines.append(f"..: {voter_data['..']}")
    
    if ' ' in voter_data:
        name = normalize_text(voter_data[' '])
        lines.append("")
        lines.append(" :")
        name_lines = split_text(name, width=40)
        for nl in name_lines:
            lines.append(f"  {nl}")
    
    age_gender_line = ""
    if '()' in voter_data:
        age_gender_line += f": {voter_data['()']} "
    if '' in voter_data:
        if age_gender_line:
            age_gender_line += " | "
        age_gender_line += f": {voter_data['']}"
    if age_gender_line:
        lines.append("")
        lines.append(age_gender_line)
    
    if '/ ' in voter_data and voter_data['/ ']:
        parent = normalize_text(voter_data['/ '])
        lines.append("")
        lines.append("/ :")
        parent_lines = split_text(parent, width=40)
        for pl in parent_lines:
            lines.append(f"  {pl}")
    
    if '/ ' in voter_data and voter_data['/ '] and voter_data['/ '] != '-':
        spouse = normalize_text(voter_data['/ '])
        lines.append("")
        lines.append("/ :")
        spouse_lines = split_text(spouse, width=40)
        for sl in spouse_lines:
            lines.append(f"  {sl}")
    
    if ' ' in voter_data and voter_data[' ']:
        details = voter_data[' ']
        if details != 'Print':
            lines.append("")
            lines.append(format_divider('-'))
            lines.append(" :")
            detail_lines = split_text(details, width=40)
            for dl in detail_lines:
                lines.append(f"  {dl}")
    
    lines.append("")
    lines.append(format_divider('='))
    
    timestamp = datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    lines.append(center_text("  / Print Date"))
    lines.append(center_text(timestamp))
    
    lines.append(format_divider('='))
    lines.append("")
    lines.append(center_text("***  ***"))
    lines.append(center_text("*** Thank You ***"))
    lines.append("")
    
    return '\n'.join(lines)


def format_voter_receipt_html(voter_data):
    """
    Format voter data as HTML for QZ Tray pixel printing on 80mm thermal printer.
    
    FIX APPLIED:
    - Embeds Kalimati.otf via base64 @font-face so Devanagari renders correctly
      on ANY system, even without Nepali fonts installed.
    - Replaces Arial (which shows boxes for Nepali) with Kalimati as primary font.
    - All label and value text now display correctly in Nepali.
    """
    
    timestamp = datetime.now().strftime("%Y-%m-%d %H:%M")
    
    serial_no  = voter_data.get('..', 'N/A')
    voter_no   = voter_data.get(' ', 'N/A')
    voter_name = normalize_text(voter_data.get(' ', 'N/A'))
    age        = voter_data.get('()', 'N/A')
    gender     = voter_data.get('', 'N/A')
    parent_name = normalize_text(voter_data.get('/ ', 'N/A'))
    spouse_name = voter_data.get('/ ', '')
    
    spouse_row = ""
    if spouse_name and spouse_name.strip() and spouse_name.strip() != '-':
        spouse_name = normalize_text(spouse_name)
        spouse_row = f'<div class="info-row"><span class="label">/:</span> <span class="value">{spouse_name}</span></div>'
    
    font_face_css = _get_font_face_css()
    
    html = f"""<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        {font_face_css}

        @page {{
            size: 80mm auto;
            margin: 0;
        }}

        /* FIX: Use Kalimati as the primary font.
           Arial/Helvetica do NOT have Devanagari glyphs  they render as  boxes.
           Kalimati is embedded above so it works on any system. */
        body {{
            width: 72mm;
            font-family: 'Kalimati', Arial, sans-serif;
            font-size: 11pt;
            margin: 0;
            padding: 2mm 3mm;
            background: white;
            color: black;
            line-height: 1.3;
        }}
        .header {{
            text-align: center;
            border-bottom: 2px solid #000;
            padding-bottom: 2mm;
            margin-bottom: 2mm;
        }}
        .header-title {{
            font-family: 'Kalimati', Arial, sans-serif;
            font-size: 15pt;
            font-weight: bold;
            margin-bottom: 1mm;
        }}
        .header-subtitle {{
            font-family: Arial, sans-serif;
            font-size: 10pt;
            color: #333;
        }}
        .serial-box {{
            background: #000;
            color: #fff;
            border: 3px solid #000;
            text-align: center;
            padding: 3mm 0;
            margin: 2mm 0;
            font-size: 14pt;
            font-weight: bold;
            font-family: 'Kalimati', Arial, sans-serif;
            letter-spacing: 1px;
        }}
        .voter-number {{
            text-align: center;
            font-size: 13pt;
            font-weight: normal;
            padding: 2mm 0;
            border-top: 1px dashed #666;
            border-bottom: 1px dashed #666;
            margin: 2mm 0;
            font-family: 'Kalimati', Arial, sans-serif;
        }}
        .info-section {{
            margin: 2mm 0;
        }}
        .info-row {{
            margin: 1mm 0;
            padding: 0.5mm 0;
            font-family: 'Kalimati', Arial, sans-serif;
        }}
        /* FIX: .label was showing boxes because it inherited Arial.
           Now explicitly set to Kalimati so Nepali label text renders. */
        .label {{
            font-family: 'Kalimati', Arial, sans-serif;
            font-weight: bold;
            display: inline-block;
        }}
        .value {{
            font-family: 'Kalimati', Arial, sans-serif;
            display: inline;
        }}
        .inline-info {{
            margin: 2mm 0;
            font-family: 'Kalimati', Arial, sans-serif;
        }}
        .footer {{
            margin-top: 2mm;
            padding-top: 2mm;
            border-top: 1px solid #666;
            text-align: center;
            font-size: 9pt;
        }}
        .footer-time {{
            margin-bottom: 1mm;
            color: #555;
            font-family: Arial, sans-serif;
        }}
        .footer-thanks {{
            font-family: 'Kalimati', Arial, sans-serif;
            font-weight: bold;
        }}
    </style>
</head>
<body>
    <!-- Header -->
    <div class="header">
        <div class="header-title"> </div>
        <div class="header-subtitle">VOTER DETAILS</div>
    </div>
    
    <!-- Serial Number -->
    <div class="serial-box">..: {serial_no}</div>
    
    <!-- Voter Number (Prominent) -->
    <div class="voter-number"> : {voter_no}</div>
    
    <!-- Voter Information -->
    <div class="info-section">
        <div class="info-row">
            <span class="label">:</span>
            <span class="value"> {voter_name}</span>
        </div>
        
        <div class="info-row inline-info">
            <span class="label">:</span>
            <span class="value"> {age} </span>
            &nbsp;|&nbsp;
            <span class="label">:</span>
            <span class="value"> {gender}</span>
        </div>
        
        <div class="info-row">
            <span class="label">/:</span>
            <span class="value"> {parent_name}</span>
        </div>
        
        {spouse_row}
    </div>
    
    <!-- Footer -->
    <div class="footer">
        <div class="footer-time">{timestamp}</div>
        <div class="footer-thanks"> / Thank You</div>
    </div>
</body>
</html>"""
    
    return html


def create_print_preview(voter_data):
    """
    Create a print preview in Streamlit
    """
    receipt_text = format_voter_receipt(voter_data)
    
    st.markdown(f"""
    <div style="
        background: #f7fafc;
        border: 2px solid #e2e8f0;
        border-radius: 8px;
        padding: 20px;
        font-family: 'Courier New', monospace;
        font-size: 14px;
        line-height: 1.6;
        white-space: pre-wrap;
        word-wrap: break-word;
        overflow: visible;
    ">{receipt_text}</div>
    """, unsafe_allow_html=True)
    
    return receipt_text


def generate_print_button(row_data, key_suffix):
    """Generate a print button for a specific row"""
    if st.button(" Print", key=f"print_{key_suffix}"):
        return True
    return False


def show_print_dialog(voter_data):
    """Show print dialog with preview"""
    st.subheader("   / Print Preview")
    
    col1, col2 = st.columns([2, 1])
    
    with col1:
        st.info(" 58mm    (42 chars/line)")
        receipt_text = create_print_preview(voter_data)
    
    with col2:
        st.write("** :**")
        st.write(f": {voter_data.get(' ', 'N/A')}")
        st.write(f": {voter_data.get(' ', 'N/A')}")
        
        if st.button(" Download TXT", use_container_width=True):
            st.download_button(
                label=" Download Receipt",
                data=receipt_text,
                file_name=f"voter_{voter_data.get(' ', 'receipt')}.txt",
                mime="text/plain",
                use_container_width=True
            )
        
        st.success(" Ready to print!")
        st.caption("Copy text above or download to print on thermal printer")


def format_compact_receipt(voter_data):
    """Create a more compact version for quick printing"""
    lines = []
    
    lines.append(format_divider('='))
    lines.append(center_text(" "))
    lines.append(format_divider('='))
    
    if ' ' in voter_data:
        lines.append(f" : {voter_data[' ']}")
    
    if ' ' in voter_data:
        lines.append(f": {voter_data[' ']}")
    
    info = []
    if '()' in voter_data:
        info.append(f": {voter_data['()']}")
    if '' in voter_data:
        info.append(f": {voter_data['']}")
    if info:
        lines.append(" | ".join(info))
    
    if '/ ' in voter_data:
        lines.append(f"/: {voter_data['/ ']}")
    
    lines.append(format_divider('='))
    lines.append(center_text(datetime.now().strftime("%Y-%m-%d %H:%M")))
    lines.append("")
    
    return '\n'.join(lines)


